import React from 'react';
import Form_SplineCubic from '../components/Form_SplineCubic';
import Navbar from '../pages/Navbar';

export default function SplineCubic() {
    return (
        <div>
            <Navbar />
            <div className="container">
                <center><h1>Cubic Spline Interpolation</h1></center>
                <Form_SplineCubic />
            </div>
        </div>
    );
}
